var title_f43_15_44275="Cervical spinal cord anatomy";
var content_f43_15_44275=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F71763&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F71763&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 515px\">",
"   <div class=\"ttl\">",
"    Cervical spinal cord",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 495px; height: 339px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The spinal cord originates from the medulla oblongota and continues caudally through the vertebral foramina until it terminates in the lumbar area. The spinal cord possesses three main tracts: the posterior columns, corticospinal tract, and the spinothalamic tract. The posterior columns carry fine touch, vibration sense, proprioception, and pressure from the ipsilateral side. The corticospinal tract carries motor fibers to the ipsilateral side of the body. The spinothalamic tract carries pain and temperature fibers from the contralateral side of the body.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
