"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"outlineLink\" href=\"#F177658\">",
"      Dosage Forms: U.S.",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"outlineLink\" href=\"#F177644\">",
"      Generic Equivalent Available: U.S.",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
