"    This hematoxylin and eosin stain of a skin&nbsp;tissue biopsy specimen from the edge of an established lesion of bullous pemphigoid demonstrates a subepidermal blister with an edematous papillary dermis as its base. The roof of the blister consists of the intact epidermis, including the stratum basalis. Eosinophil-rich inflammatory cells, fibrin, and tissue fluid fill the blister.",
