var title_f43_15_44281="Superficial veins of hand and forearm";
var content_f43_15_44281=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=EM%2F70665&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=EM%2F70665&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 711px\">",
"   <div class=\"ttl\">",
"    Superficial veins of the hand and forearm",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 691px; height: 586px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    (A) The digital veins drain into the dorsal venous network on the dorsum of the hand, which leads to two prominent superficial vessels: the cephalic and basilic veins.",
"    <br>",
"     (B) The basilic and cephalic veins ultimately drain into the origin and termination of the axillary vein, respectively. The median cubital vein is the communication between the basilic and the cephalic veins in the cubital fossa. Perforating veins connect the superficial veins to the deep veins. Arrows indicate the flow of lymph within lymphatic vessels that converge toward the vein and drain into the cubital and axillary lymph nodes.",
"     <div class=\"footnotes\">",
"     </div>",
"     <div class=\"reference\">",
"      Reproduced with permission from: Moore KL, Dalley AF. Clinically Oriented Anatomy, 5th ed, Lippincott Williams &amp; Wilkins, Philadelphia 2006. Copyright &copy; 2006 Lippincott Williams &amp; Wilkins.",
"     </div>",
"     <div class=\"contractual\">",
"      <br/>",
"      <a href=\"file://www.lww.com\">",
"       file://www.lww.com",
"      </a>",
"     </div>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
