var title_f43_15_44282="Diabetic nephropathy Light";
var content_f43_15_44282=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEPH%2F56156%7ENEPH%2F63754%7ENEPH%2F77108&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEPH%2F56156%7ENEPH%2F63754%7ENEPH%2F77108&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1040px;\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Diabetic nephropathy",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 377px; height: 279px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Light micrograph showing diffuse and nodular (N) glomerulosclerosis in diabetic nephropathy. Note the dense appearance of the deposits and the rim of cells around the nodules, which distinguish this disorder on light microscopy from fibrillary glomerulonephritis or amyloidosis.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Helmut Rennke, MD.",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Normal glomerulus",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 396px; height: 253px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Light micrograph of a normal glomerulus. There are only 1 or 2 cells per capillary tuft, the capillary lumens are open, the thickness of the glomerular capillary wall (long arrow) is similar to that of the tubular basement membranes (short arrow), and the mesangial cells and mesangial matrix are located in the central or stalk regions of the tuft (arrows).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Helmut G Rennke, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1040px;\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Advanced diabetic glomerulosclerosis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 378px; height: 256px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Light micrograph in advanced diabetic nephropathy shows diffuse and nodular mesangial expansion and characteristic hyaline thickening of the arteriole at the glomerular hilum (arrow). Although not shown, diabetes typically affects both afferent and efferent arterioles; in comparison, only the afferent arteriole is usually involved with hypertensive injury.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Helmut Rennke, MD.",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Normal glomerulus",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 396px; height: 253px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Light micrograph of a normal glomerulus. There are only 1 or 2 cells per capillary tuft, the capillary lumens are open, the thickness of the glomerular capillary wall (long arrow) is similar to that of the tubular basement membranes (short arrow), and the mesangial cells and mesangial matrix are located in the central or stalk regions of the tuft (arrows).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Helmut G Rennke, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1040px;\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Basement membrane thickening in diabetic nephropathy",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 378px; height: 243px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Electron micrograph in diabetic nephropathy shows a 2 to 3 fold increase in the thickness of the glomerular basement membrane (GBM). Although not seen, the mesangium is also expanded by basement membrane-like material, a process that contributes to nodule formation and glomerulosclerosis.",
"    <div class=\"footnotes\">",
"     Mes: mesangium; Ep: epithelial cell.",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Helmut Rennke, MD.",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Electron micrograph of a normal glomerulus",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 377px; height: 266px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Electron micrograph of a normal glomerular capillary loop showing the fenestrated endothelial cell (Endo), the glomerular basement membrane (GBM), and the epithelial cells with its interdigitating foot processes (arrow). The GBM is thin, and no electron dense deposits are present. Two normal platelets are seen in the capillary lumen.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Helmut Rennke, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
